import React, { Component } from 'react';
import './App.css';
import Header from './components/layout/header.js';
import Footer from './components/layout/footer.js';

class App extends Component {
  render() {
    return (
      <div className="App">
        <div id='container'>
            <Header/>
            <div id='content'></div>
            <Footer id='footer'/>
        </div>
      </div>
    );
  }
}

export default App;
